Verenigde Staten
Horror

geregisseerd door George Bessudo
met Alex A. Quinn, Tara Gerard en Vanessa Viola


Wegens het overlijden van haar vader, gaat Sam samen met haar vrienden naar de begravenis op het achtergelaten landgoed van haar vader. Dit wordt echter een nachtmerrie omdat ze achtervolgd wordt door een gestoorde moordenaar, waardoor Sam behalve haar vader, nog meer dierbaren verliest.
